import ReturnPrixCdf from './PrixCdf';
import ReturnPrixUsd from './PrixUsd';
import ReturnPrixCdfBlocked from './PrixBlocked';

// Return Box All
export default function ReturnBox() {
 return (
  <div className='wrp-box-all'>
   <ReturnPrixCdf />
   <ReturnPrixUsd />
   <ReturnPrixCdfBlocked />
  </div>
 );
};
